@Paul Thoreau Primeiro que não sou nazista.
 Eu admiro o Fascismo, é diferente do Nazismo. Fascismo tem origem latina, seu criador é latino. E no Fascismo é bem neutro na questão de miscigenação e raças, etc. Portanto, não ligo se me chamarem de fascista. Mas, Nazismo é bem racista e genocida e só me aceitariam para um trabalho escravo. 
 Já que você se declara comunista, tudo bem! temos algo em comum, admiramos ideologias totalitários.

